import React, { useState, useEffect, useCallback } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import axios from 'axios';
import './App.css';
import logo from './assets/Logo.png';
import solIcon from './assets/solIcon.png';
import estrellaIcon from './assets/estrellaIcon.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTrash, faFilter } from '@fortawesome/free-solid-svg-icons';
import Filters from './components/filters/Filters';
import ResultCard from './components/resultCard/ResultCard';

// Función que gestiona la búsqueda y los resultados
const useFetchResults = (setResults, setFilteredResults, setNotFound) => {
  const fetchResults = useCallback(async (searchQuery) => {
    if (!searchQuery) return;
    try {
      const response = await axios.post('http://localhost:9200/restaurants/_search', {
        size: 1000,
        query: {
          bool: {
            should: [
              { term: { "name.keyword": searchQuery.toLowerCase() } },
              { match: { "name": searchQuery.toLowerCase() } },
              { wildcard: { "name": `*${searchQuery.toLowerCase()}*` } },
              { wildcard: { "meal_type": `*${searchQuery.toLowerCase()}*` } }
            ],
            minimum_should_match: 1
          }
        }
      });

      const processedHits = processSearchResults(response.data.hits.hits);
      setResults(processedHits);
      setFilteredResults(processedHits);
      setNotFound(processedHits.length === 0);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  }, [setResults, setFilteredResults, setNotFound]);

  return { fetchResults };
};

// Función para procesar los resultados de búsqueda
const processSearchResults = (hits) => {
  return hits.map(hit => {
    const restaurant = hit._source;
    if (!restaurant.price && restaurant.menu_options?.length > 0) {
      const menuPrices = restaurant.menu_options
        .map(menu => {
          if (!menu.price) return 0;
          const priceStr = menu.price.replace(/[^0-9.,]/g, '');
          return parseFloat(priceStr.replace(',', '.')) || 0;
        })
        .filter(price => price > 0);

      if (menuPrices.length > 0) {
        const averagePrice = menuPrices.reduce((a, b) => a + b, 0) / menuPrices.length;
        restaurant.price = getPriceSymbols(averagePrice);
      }
    }
    return { ...hit, _source: restaurant };
  });
};

// Función para convertir el precio medio en símbolos €
const getPriceSymbols = (averagePrice) => {
  if (averagePrice <= 50) return '€';
  if (averagePrice <= 100) return '€€';
  if (averagePrice <= 150) return '€€€';
  return '€€€€';
};

function App() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);
  const [filteredResults, setFilteredResults] = useState([]);
  const [notFound, setNotFound] = useState(false);
  const [filters, setFilters] = useState({ starsOrSoles: 'both', priceRange: '', mealType: '', starNumber: '' });
  const [showFilters, setShowFilters] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  const { fetchResults } = useFetchResults(setResults, setFilteredResults, setNotFound);

  const handleSearch = (e) => {
    e.preventDefault();
    fetchResults(query);
  };

  useEffect(() => {
    if (location.state?.query) {
      setQuery(location.state.query);
      fetchResults(location.state.query);
    }
  }, [location.state, fetchResults]);

  const handleResultClick = (restaurant) => {
    const restaurantName = restaurant._source.name.replace(/\s+/g, '-').toLowerCase();
    navigate(`/${restaurantName}`, { state: { query, restaurant: restaurant._source } });
  };

  const resetState = () => {
    setQuery('');
    setResults([]);
    setFilteredResults([]);
    setNotFound(false);
  };

  return (
    <div className="App">
      <img src={logo} alt="Logo" className="App-logo" onClick={resetState} style={{ cursor: 'pointer' }} />
      <form onSubmit={handleSearch} className="form">
        <input
          type="text"
          placeholder="Search for restaurants..."
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          className="input"
        />
        <button type="submit" className="button">Buscar</button>
        <button type="button" className="button" onClick={() => setShowFilters(!showFilters)}>
          <FontAwesomeIcon icon={faFilter} />
        </button>
      </form>
      {showFilters && <Filters filters={filters} setFilters={setFilters} setFilteredResults={setFilteredResults} results={results} />}
      {notFound && <p className="notFound">No se encontraron resultados para "{query}".</p>}
      <div className="resultsGrid">
        {filteredResults.map((result) => (
          <ResultCard key={result._id} result={result} onClick={() => handleResultClick(result)} />
        ))}
      </div>
    </div>
  );
}

export default App;
